import React, { PureComponent } from 'react'

import LogoImage from './styled/Outer'

export default class Image extends PureComponent{
    constructor(props){
        super(props)
        this.state={}
    }

    render(){
        const {
            source, 
            height,
            width
        } = this.props

        return(
            <LogoImage src={source} height={height} width={width}/>
        )
    }
}
